import React from 'react';
import CartItem from './cartItem';

const Cart = () => {
  const cartItems = [
    {
      name: 'Product 1',
      description: '',
      price: '',
      image: '',
    },
    {
      name: '',
      description: 'Description of product 2',
      price: 15.99,
      image: 'path/to/image2.jpg',
    },
    // Add more items as needed
  ];

  return (
    <div className="cart">
      {cartItems.map((item, index) => (
        <CartItem key={index} item={item} />
      ))}
    </div>
  );
};

export default Cart;
